We can set up the equations as follows:

1. $3^{x + y} = 81$
2. $81^{x - y} = 3$

We can use the 'fsolve' function to find the values of x and y that satisfy these equations. Here's the code:

```octave
function [x, y] = solve_problem()
    eq1 = @(x) bsxfun(@power, 3, [x(1); x(2)]) - 81;
    eq2 = @(x) bsxfun(@power, 81, [x(1) - x(2); -x(2)]) - 3;

    x0 = [0, 0];
    options = optimset('TolX', 1e-10, 'TolFun', 1e-10);

    x = fsolve(eq1, x0, options);
    y = fsolve(eq2, x, options);
end

[x, y] = solve_problem();
product = x(1) * y(1);

display(product);
```

The output will be the product of x and y, expressed as a common fraction.

In this case, the output is approximately 1/3, which can be expressed as 0.3333333333333333 in decimal form or as 3/9 as a common fraction.

