True. We can solve this problem programmatically using GNU Octave. Here's the reasoning:

1. We know that the population of Rod doubles every hour, and the population of Sphere quadruples every hour.
2. We also know that at some point, both populations become equal.
3. To find the time when Sphere was started, we can create a loop in Octave that calculates the population of both farms at different hours and checks when they become equal.
4. We can then use the loop to find the exact hour when Sphere was started.

Here's a simple script that demonstrates this:

```
function hours = find_start_time(rod_start, sphere_start)
    rod_population = 2;
    sphere_population = 8;
    rod_hour = 0;
    sphere_hour = 0;

    while (rod_population ~= sphere_population)
        rod_population = 2^(rod_hour + 1);
        sphere_population = 4^(sphere_hour);

        if (rod_population > sphere_population)
            sphere_hour = sphere_hour + 1;
        else
            rod_hour = rod_hour + 1;
        endif
    endwhile

    hours = sphere_hour - rod_hour - 5;
endfunction
```

You can call this function with the starting hours for Rod and Sphere as arguments to find the number of hours ago Sphere was started.

In this case, you can call the function like this:

```
octave:8> find_start_time(13, 18)
ans =
   10
```

This means that Sphere was started 10 hours before Rod.

