% Define the equation for the first inequality
eq1 = 54*x - 144 >= 0;

% Define the equation for the second inequality
eq2 = 12 - 20*x > 0;

% Find the intersection of the two inequalities
intersection = find_intersect(eq1, eq2);

% If there is no intersection, print "No solution"
if isempty(intersection)
    fprintf('No solution\n');
else
    % Find the minimum and maximum values of p in the intersection
    pmin = min(intersection);
    pmax = max(intersection);

    % Print the solution in interval notation
    fprintf('The solution is in the interval [%d, %d].\n', pmin, pmax);
end

function intersection = find_intersect(eq1, eq2)
    % Find the roots of the equations
    roots1 = roots(coefficients(eq1));
    roots2 = roots(coefficients(eq2));

    % Filter out the non-real roots
    roots1 = roots1(imag(roots1) == 0);
    roots2 = roots2(imag(roots2) == 0);

    % Find the intersection of the roots
    intersection = intersect1d(roots1, roots2);
end

