(16)(8)(-16)(-8)& = (2^4)(2^3)(-2^4)(-2^3)\\
& = 2^{4+3+4+3} \\&= 2^{14}\\& = 2^{10}\cdot 2^4 = (1024)(16) = .
\end{align*}

